(45891, '1488B5E5-060E-4E6D-9045-1AC15A2919F6', 'No way!!!', 'Nitzan', 'David', '2022-03-21T10:12:15.355005'),
(45892, '93A99C40-E8EF-419D-9534-450462EF92E7', 'Hey love, I‚Äôm so very sorry about this weekend and I understand how painful and frustrating it felt to you. It‚Äôs hard for me to understand looking back how I thought I was in compliance with our agreements when looking back I objectively just wasn‚Äôt. I reached out to Priscilla to talk through, as I realized yesterday morning how I‚Äôve tapped into something much deeper and sadder and needier than I‚Äôve been aware of‚Ä¶and really couldn‚Äôt communicate to you. The range of emotions this weekend was crazy‚Ä¶. From feeling frustrated and ashamed for taking us a step backwards after what I‚Äôve felt has been two steps forward. To feeling both sexy and vulnerable with you exploring desire and sexuality and play. I can just be me with you‚Ä¶and only with you can I experience what it is like to lose myself‚Ä¶and sometimes not even be aware of where I end and you begin‚Ä¶physically and emotionally. We push frontiers together.', 'David', 'Nitzan', '2022-03-21T10:20:18.891441'),
(45894, 'FA5C709D-C20C-4708-A4FE-783204326E1B', 'And I woke up the morning feeling angry.  I had a vivid memory of the last time you and joe went out together. He picked you up at our house. You needed time to finish getting ready and blow dry your hair. I was sitting on the red couch while chatting with him. Then you came upstairs looking stunning and sexy for him. And then you came back home and got in bed with me. I don‚Äôt remember whether you took a shower or not before you came into bed. But the thought of me wrapping my body around you after that with traces of him on you makes me feel sick. I feel lots of anger toward him. How he could come into my house like that and talk to me like that is a level of disrespect I could never imagine doing to someone else. Was there no sense of shame?', 'David', 'Nitzan', '2022-03-21T10:27:24.114579'),
(45895, '3606F637-7EF0-4A12-A1F2-6B20956DD64E', 'Up to now, you being together with him has been an abstraction. And now that it is real, I‚Äôm struggling with being generous. It feels extremely tainted. I wish you would have been more thoughtful in addressing. I didn‚Äôt know that you were planning to see him at this conference and being just told about it gave me a bit of a shock. I know how important this relationship is to you and I‚Äôm trying to be generous. And it is very difficult for me. Especially the idea of you two being in a hotel room together while I‚Äôm at home taking care of Orli having canceled my date with ilsa. I‚Äôm really struggling. ', 'David', 'Nitzan', '2022-03-21T10:32:23.231923'),
(45896, '5458586D-8F94-4081-A0EF-9CFF2640AEE1', 'I meant it with every fiber last night that I feel you are the most beautiful creature on earth. ', 'David', 'Nitzan', '2022-03-21T10:33:10.055367'),
(45897, '65B474BC-7E83-46E4-AEBB-DFAB5F902C80', 'I love our lives together‚Ä¶how we are exploring the edges and that the non monogamy brings up all sorts of content for each of us to work with. It‚Äôs hard and feels so tough when we fall down to get back up again.', 'David', 'Nitzan', '2022-03-21T10:35:05.372566'),
(45898, '7AF39B85-B100-4830-9C1E-1C453E4D9D32', 'And I know this time‚Ä¶it was me, and I‚Äôm sorry. I love you so very dearly. ', 'David', 'Nitzan', '2022-03-21T10:35:54.799033'),
(45899, 'BA6E2A19-744F-4001-8B52-3667A98F9C5D', 'Thanks love for the heartfelt notes this morning. They touch my heart in lots of ways. IÔ∏è very much appreciate you sharing the range of roller coaster emotions that come with the realizations of this weekend. IÔ∏è too have had them. But more than that, I‚Äôm really proud of us for working through a lot of our hard conversations from a place of groundedness. We talked about feelings and what was causing us pain. We talked about needs and boundaries without letting ourselves get out of regulation. IÔ∏è didn‚Äôt get big and yell. Neither did you in defense. It felt like a lot of what we have worked on for years was blooming.', 'Nitzan', 'David', '2022-03-21T11:07:15.370147'),
(45900, '2C85D399-0C8B-481C-B745-A4AC245B0BCE', 'And that‚Äôs what IÔ∏è love so much about you and us.', 'Nitzan', 'David', '2022-03-21T11:07:23.655973'),
(45901, '9088025F-7BCF-43A4-9A43-B8DF2F87475E', 'Our ability to continue to invest in us and in our own growth as people. You inner work inspires me to do inner work. And your desire to know yourself and what is behind the feelings in your body has taken me to a new world.', 'Nitzan', 'David', '2022-03-21T11:08:11.834012'),
(45902, 'B3032D22-9606-4ECC-A792-6DCC7F6507B4', 'IÔ∏è hear you on the Joe front and IÔ∏è know emotions aren‚Äôt linear. You‚Äôve shared that memory of Joe a few times and IÔ∏è understand it remains strong in your memory.', 'Nitzan', 'David', '2022-03-21T11:08:49.826269'),
(45903, '6029D994-4BEE-4DCC-B6E4-278F823E98F3', 'Joe is a complex human in the same way Ilsa is -- no one wants to violate agreements. And yet sometimes that is what happens. It comes with pain and for US, we are transparent in a way that I‚Äôm proud of. I can‚Äôt and won‚Äôt comment on other people‚Äôs marriages or inner dynamics. But IÔ∏è know that you and IÔ∏è are on the right path.', 'Nitzan', 'David', '2022-03-21T11:10:21.932796'),
(45904, 'F834041E-0221-4025-AFDC-CBA2641CB40F', 'While you may not recall, IÔ∏è have definitely shared that IÔ∏è would be seeing Joe at ASU GVS. IÔ∏è sat at home for 3 months, living in excoriating pain, while you were out on dates. IÔ∏è did that making an upfront investment in our non monogamy and knowing that IÔ∏è needed to do that so that when my turn came around, IÔ∏è could do the same.', 'Nitzan', 'David', '2022-03-21T11:12:11.052814'),
(45905, '353540F2-237E-4C85-B3AB-0BC196A4363D', 'So IÔ∏è really do hope you can find a place for generosity', 'Nitzan', 'David', '2022-03-21T11:12:19.240440'),
(45906, 'CD7D8310-F28E-41AC-AD47-A028D818F010', 'We aren‚Äôt on perfectly parallel paths at every second of this journey. And sometimes that has to be ok.', 'Nitzan', 'David', '2022-03-21T11:12:36.480829'),
(45907, '18BA5B84-E85D-41E4-B840-9601A71C51B9', 'IÔ∏è like when we both go out on dates on the same night.', 'Nitzan', 'David', '2022-03-21T11:12:46.502207'),
(45908, '875C0187-C610-4302-98AD-88ACD18F5DEE', 'But IÔ∏è also NEED to feel like you and Ilsa are doing the separating and space that will allow your relationship to be boundried and work in the long term. So please think of your skipped date as an investment into the future -- in similar ways to the investments IÔ∏è was making in our future.', 'Nitzan', 'David', '2022-03-21T11:13:51.900260'),
(45909, '23004518-C321-48CF-AE3B-833AD4A65A4E', 'If you and Ilsa had done this separating 8 weeks ago, when IÔ∏è thought you were, we‚Äôd be more parallel. IÔ∏è wish that were where we were today. Alas, it isn‚Äôt and the road to getting here is bumpy.', 'Nitzan', 'David', '2022-03-21T11:14:41.373490'),
(45910, '8F8EF439-78C7-45FE-AE10-A255ADEF97FE', 'Your reflectiveness and awareness is what keeps me engaging and forgiving.', 'Nitzan', 'David', '2022-03-21T11:14:55.407726'),
(45911, 'BC74CA2F-23C2-44A3-AD04-EB7EB9753DC2', 'And IÔ∏è hope the same is true for you to me. IÔ∏è know IÔ∏è hurt you in so many ways. And IÔ∏è have and will continue to do teshuva for as long as IÔ∏è need to.', 'Nitzan', 'David', '2022-03-21T11:15:23.611582'),
(45912, 'C6790D8E-9B9B-4E28-963D-3AD0BC5A35EF', 'And IÔ∏è totally appreciate your neediness and your desire for attention and connection from women. IÔ∏è feel totally comfortable with that -- as long as it has boundaries -- and that our space and our connection is primary. And think about how much growing we DO do, constantly, because we are so thoughtful and conscious about our investment in us. IÔ∏è don‚Äôt know ANY couple that is doing the conscious work of making the unit as strong and fortified, fresh, new, loving, in the way we do.', 'Nitzan', 'David', '2022-03-21T11:19:17.163176'),
(45913, 'E9D7D736-19DC-4B4A-9339-484E2DD73BF6', 'And IÔ∏è am beyond proud of that', 'Nitzan', 'David', '2022-03-21T11:19:21.574471'),
(45914, '7CF29448-B7A9-4067-BF10-9A5D16821C79', 'Oh and you in those golden underwear are so freaken awesome that IÔ∏è literally don‚Äôt know what to say other than you are so very hot and IÔ∏è am so very attracted and in love with you.', 'Nitzan', 'David', '2022-03-21T11:20:09.026092'),
(45924, '416A1225-B7A9-4761-86A1-06BAB07EF565', 'Hey Love, just to let you know that I reached out to Ilsa and we agreed to have a single day during the week where we will have either a catch up text message exchange or a short phone call. We won‚Äôt do it on weekend to respect family time and focus. I proposed Friday. Also, I went back to re-read our agreement. We agreed to 1-2 ‚Äúconversation bursts‚Äù per week. We didn‚Äôt specify that this was contact on a single or over multiple days. Either way, I was out of compliance‚Ä¶.no doubt. And, I also didn‚Äôt have clarity that if that happened over‚Ä¶.2 days (like my Purim burst‚Ä¶.which I wrote something, and then she replied the next day)‚Ä¶.that this was not within our agreement. Again, I‚Äôm accountable for pushing over the line multiple times. I think this new arrangement has  better clarity and I hope will give you piece of mind.', 'David', 'Nitzan', '2022-03-21T15:34:51.661000'),
(45925, '2BC3B2BC-95B7-4F98-9100-C99C8C074CEC', 'Thanks love. IÔ∏è really appreciate this. I appreciate your accountability on this. Did you also share with Ilsa that the April date is going to be skipped so that some of this separation can happen and the new norms can be more firmly planted?', 'Nitzan', 'David', '2022-03-21T15:40:37.435949'),
