(45933, '4826F60D-C733-4725-AA78-4FFE5A71A73F', 'I did not. I understand this is what you want, but it warrants further discussion. I don‚Äôt feel on board with this solution and I‚Äôd like find a way to work through this that doesn‚Äôt get us into our lawyerly battle for fairness and justice but rather focuses on supporting each other and our emotional needs. I feel you are trying to make the case, crassly put  ‚Äúwell I stayed home and suffered‚Ä¶so now the shoes is on the other foot and it‚Äôs your turn.‚Äù   I am not sure I am okay with you having a sexual relationship with joe again. I‚Äôm really struggling with this. ', 'David', 'Nitzan', '2022-03-21T17:19:19.098865'),
