(46089, 'C3DDC96C-0766-456F-B5D7-F2E467887ABF', 'It‚Äôs also important to note that IÔ∏è did not ask you to not be monogamous in April. I am not asking you to shut down non monogamy. IÔ∏è asked you to create distance from Ilsa because you hadn‚Äôt done it when you said you were doing it. If you want to go out on a date with anyone else, you are welcome to. Just want to be sure IÔ∏è‚Äôm clear. IÔ∏è‚Äôm not choosing who you date. Ilsa is in the cards for forever as far as IÔ∏è‚Äôm concerned. IÔ∏è was just asking you to create distance for one month since you didn‚Äôt follow through on our agreement. We never built in a clause for what happens if one of us violates agreements, we just said that if one person feels unsafe they can turn it off for everyone. IÔ∏è don‚Äôt feel unsafe. IÔ∏è feel my trust has been violated. And IÔ∏è wish there was some kind of agreement that we could add in for that. Because it‚Äôs a different circumstance. the byproduct of that violation is that IÔ∏è just cannot be close to you when IÔ∏è know you are going to see her so soon after you violated our agreement. That is why IÔ∏è am asking you to do me the favor of having a month of distance. If seeing Ilsa matters more to you than our connection, IÔ∏è understand that parody matters to you above everything else. ', 'Nitzan', 'David', '2022-03-24T23:50:14.532907'),
