(46098, '67FF786E-1137-476B-A941-70303354C684', 'It‚Äôs 3am and IÔ∏è haven‚Äôt slept for 1 min yet. IÔ∏è‚Äôm struggling so much because IÔ∏è‚Äôm back to that level of pain from sat night and Sunday morning around how can IÔ∏è forgive and move forward when IÔ∏è feel like IÔ∏è don‚Äôt know how to trust. IÔ∏è feel so violated and hurt. And IÔ∏è can‚Äôt sleep.', 'Nitzan', 'David', '2022-03-25T02:46:35.273080'),
(46099, '9C8E78F7-6DA2-46DC-859C-F2927EAE8616', 'I‚Äôm truly sorry that you feel hurt and I know I have more work to do to. I feel we are at an impasse on how to resolve this. I reached out to Priscilla and she is available at 3 to talk with us. Until then, Im here to support you. you can let me know how I can do that. I too didn‚Äôt sleep. ', 'David', 'Nitzan', '2022-03-25T07:42:23.331242'),
(46101, '1901259F-14F7-42CF-B5D8-D3BC851B1A92', 'Love, I want to share with you some thoughts I wrote down on Wednesday but wanted time to process on my own and with Priscilla‚Äôs guidance. I will come to this conversation with an open heart and mind. We both have a lot of active pain to work through‚Ä¶..  Love, I‚Äôm really struggling today about you and joe and how we‚Äôve left things. It‚Äôs just activated so much anger and hurt. It‚Äôs very hard for me to accept stretching to work with you going out with joe at a conference while on the same night  making a sacrifice to rebuild trust with you in my communication with Ilsa.  I‚Äôm not okay with you being with Joe‚Ä¶I have no track record of trust with you when it comes to this relationship‚Ä¶.Do I trust you‚Ä¶.yes‚Ä¶I do‚Ä¶we‚Äôve worked hard and continue to work hard at this‚Ä¶but this relationship to me is so radioactive that I am shaking right now just thinking about it.  and I get that I really don‚Äôt have a choice‚Ä¶.that in our non monogamy we don‚Äôt get to chose. If that is true, then why do you get to chose who I go out with the night you are out with Joe?   I acknowledge and am accountable for not getting my communication cadence right. And that I have work to do to figure out what‚Äôs beneath this pattern. And I am motivated and committed to doing this work‚Ä¶.to get better. I can‚Äôt promise perfection here. I wasn‚Äôt even conscious that I was off track.     And, I need acknowledgment of the extraordinary stretch I am making for you, despite the hurt,  and that there is not a double standard at play in choosing who we get to see and when we get to see which partners.   It just keeps resurfacing for me‚Ä¶and I‚Äôm really struggling with it‚Ä¶', 'David', 'Nitzan', '2022-03-25T08:39:22.105449'),
